import React from 'react'
import './profile.scss'

const Profile = ({ darkMode }) => {
  return (
    <div className={darkMode ? 'profile darkMode' : 'profile'}>
      <div className='profile__container'>gg</div>
    </div>
  )
}

export default Profile
